import { Box, Container } from "@mui/material";
import "./App.css";
import LayoutAppBar from "./app/components/AppBar";

function App() {
  return (
    <>
      <LayoutAppBar />
      <Container>
        <Box sx={{ backgroundImage: `url(${logo})` }}></Box>
      </Container>
    </>
  );
}

export default App;
